                if (isAnyToggleChecked && !isActive) {
                    this.saveRejectCTA.classList.add(this.SAVE_REJECT_CTA_CLASS + '--active');
                } else if(!isAnyToggleChecked && isActive) {
                    this.saveRejectCTA.classList.remove(this.SAVE_REJECT_CTA_CLASS + '--active');
                }
